import React from 'react';
import Hero from './components/Hero';
import About from './components/About';
import Skills from './components/Skills';

function App() {
  return (
    <div className="min-h-screen bg-gray-50">
      <main>
        <Hero />
        <About />
        <Skills />
        {/* Other components */}
      </main>
    </div>
  );
}

export default App;
